import React from 'react';
import {Button, Icon, Input, List, Form} from "antd";

const Profile = () => {
    return(
        <div>
            <Form style={{}}>
                <Input addonBefore="닉네임" />
                <Button type="primary">수정</Button>
            </Form>
            <List
                style={{marginBottom : '20px'}}
                grid={{ gutter : 4, xs:2, md:3}}
                header={<div>팔로워 목록</div>}
                loadMoer={<Button style={{ width : '100%'}}>더 보기</Button>}
                bordered
                dataSource={['제로초', '바보', '노드버드 오피셜']}
                renderItem =  {item => (
                    <List.Item>
                        <Card action = {[<Icon type="stop"></Icon>]}>
                            <Card.Meta description={item}/>
                        </Card>
                    </List.Item>
                )}
            />
            <List
                style={{marginBottom : '20px'}}
                grid={{ gutter : 4, xs:2, md:3}}
                header={<div>팔로잉 목록</div>}
                loadMoer={<Button style={{ width : '100%'}}>더 보기</Button>}
                bordered
                dataSource={['제로초', '바보', '노드버드 오피셜']}
                renderItem =  {item => (
                    <List.Item>
                        <Card action = {[<Icon type="stop"></Icon>]}>
                            <Card.Meta description={item}/>
                        </Card>
                    </List.Item>
                )}
            />

        </div>
    );

};

export default Profile;
